import React from "react";
import ReactDOM from "react-dom";
import useStyles from "./HomePageStyles";
import Grid from "@material-ui/core/Grid";
import Box from '@material-ui/core/Box';
import LoungeImg from "./components/lounge-img/LoungeImg";
import LoungeJpeg from "../../lib/assets/img/Main.jpeg";
import GetPampyButton from "../../components/get-pampy-button/GetPampyButton";

function HomePage(props) {
  const classes = useStyles();
  return (
    <Box display="flex" flexDirection="column">
      <Box className={classes.boxItem} display="flex" flexDirection="column" justifyContent="flex-center">
        <img className={classes.imgContainer} src={LoungeJpeg} />
      </Box>
      <Box className={classes.boxItem} display="flex" flexDirection="column" justifyContent="flex-center">
        
      </Box>
    </Box>
  )
}

HomePage.propTypes = {};

export default HomePage;
